import React from 'react';
import { Routes, Route, Navigate } from 'react-router-dom';
import Sidebar from '../../components/Sidebar';
import Navbar from '../../components/Navbar';
import MaintenanceRequests from './maintenance/MaintenanceRequests';

const links = [{ to: '/maintenance/maintenance-requests', label: 'Maintenance Requests' }];

export default function MaintenanceDashboard() {
  return (
    <div className="d-flex" style={{ minHeight: '100vh' }}> {/* Add this */}
      <Sidebar links={links} />
      <div className="flex-grow-1 d-flex flex-column"> {/* Add d-flex flex-column */}
        <Navbar />
        <main className="p-4 flex-grow-1" style={{ backgroundColor: 'var(--color-off-white)' }}>
          <Routes>
            <Route path="/" element={<Navigate to="/maintenance/maintenance-requests" />} />
            <Route path="maintenance-requests" element={<MaintenanceRequests />} />
            <Route path="*" element={<Navigate to="/maintenance/maintenance-requests" />} />
          </Routes>
        </main>
      </div>
    </div>
  );
}
